import React from "react";
import { Parallax, Background } from "react-parallax";

import { TheOriginalSixStyle } from "../2_styles/1_layout/TheOriginalSixStyle";

export default function TheOriginalSix() {
  return (
    <div>
      <Parallax
        // blur={0}
        bgImage={require("../3_images/2_theInitiative/bg_initiative-banner.jpg")}
        bgImageAlt="the cat"
        strength={200}
      >
        Put some text content here - even an empty div with fixed dimensions to
        have a height for the parallax.
        <div style={{ height: "100vh" }} />
      </Parallax>

      <TheOriginalSixStyle>
        <div className="text">
          <p>Some Title Here</p>
        </div>
      </TheOriginalSixStyle>
    </div>
  );
}
